      ELSE
         IS=1
      ENDIF
      COLAT=UMR*(90.-DIPL)                    
      AZ=.2618*SLT    
      CALL SPHARM(A,8,8,COLAT,AZ)
      IF(IS.EQ.2) THEN
         KEND=3
      ELSE
         KEND=4
      ENDIF                  
      DO 2 K=1,KEND      
      STE=0.          
      DO 1 I=1,81     
 1       STE=STE+A(I)*C(K,IS,I)                       
 2     TE(K)=10.**STE
      IF(IS.EQ.2) THEN
         DIPL=-DIPL
         COLAT=UMR*(90.-DIPL)                    
           CALL SPHARM(A,8,8,COLAT,AZ)
           STE=0.          
           DO 11 I=1,81     
 11            STE=STE+A(I)*C(4,2,I)                       
           TE(4)=10.**STE
    	ENDIF

